const Projetos = () => {
  const projetos = [
    {
      id: 1,
      titulo: "Landing Page (TypeScript)",
      desc: "Página moderna desenvolvida em React + TypeScript.",
      img: "URL_DA_IMAGEM_DO_PROJETO_1",
      link: "URL_DO_REPOSITORIO_1",
    },
    {
      id: 2,
      titulo: "E-commerce Furniro",
      desc: "Frontend em TS + Backend NestJS/PostgreSQL.",
      img: "URL_DA_IMAGEM_DO_PROJETO_2",
      link: "URL_DO_REPOSITORIO_2",
    },
    {
      id: 3,
      titulo: "Petshop",
      desc: "Site completo com HTML, CSS e JavaScript.",
      img: "URL_DA_IMAGEM_DO_PROJETO_3",
      link: "URL_DO_REPOSITORIO_3",
    },
    {
      id: 4,
      titulo: "Landing Page Mr. Zeus",
      desc: "Landing page desenvolvida em TypeScript.",
      img: "URL_DA_IMAGEM_DO_PROJETO_4",
      link: "URL_DO_REPOSITORIO_4",
    },
  ];

  return (
    <section className="proj-section" id="projetos">
      <h2 className="proj-title">Projetos</h2>

      <div className="proj-cards-container">
        {projetos.map((p) => (
          <div key={p.id} className="proj-card">
            <div
              className="proj-card-img"
              style={{ backgroundImage: `url(${p.img})` }}
            ></div>

            <div className="proj-card-info">
              <h3>{p.titulo}</h3>
              <p>{p.desc}</p>

              <a href={p.link} target="_blank" rel="noopener noreferrer">
                <button className="proj-btn">Ver Projeto</button>
              </a>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projetos;
